// src/ui/components/Input.ts
function Input(label, value, callback, validate, editor) {
  let id = String(performance.now());
  function checkValidity(value2) {
    if (editor)
      editor.dirty = true;
    if (validate)
      if (validate(value2)) {
        input.classOff("invalid");
        callback(value2);
        if (editor)
          editor.errors.set(label, false);
      } else {
        input.classOn("invalid");
        if (editor)
          editor.errors.set(label, true);
      }
  }
  let input = new Html("input").id(id).attr({ type: "text", value }).on("input", (e) => {
    const target = e.target;
    checkValidity(target.value);
  });
  if (validate)
    validate(value);
  return new Html("div").class("input-group").appendMany(new Html("label").attr({ for: id }).text(label), input);
}

// src/ui/components/Modal.ts
var Modal_default = {
  modal: function(title, content, parent = "body", ...buttons) {
    if (content === undefined && title) {
      content = "" + title;
      title = "Alert";
    }
    let modalContent = new Html("div").class("modal-content");
    let modalHeader = new Html("div").class("modal-header");
    let modalBody = new Html("div").class("modal-body");
    modalContent.appendMany(modalHeader, modalBody);
    const x = new Html("div").class("modal").append(modalContent);
    new Html("span").text(title).appendTo(modalHeader);
    if (content instanceof Html === false) {
      new Html("span").html(content).appendTo(modalBody);
    } else {
      content.appendTo(modalBody);
    }
    new Html("div").class("flex-group").appendTo(modalBody);
    for (let i = 0;i < buttons.length; i++) {
      let button = buttons[i];
      if (!button.text || !button.callback)
        throw new Error("Invalid button configuration");
      const b = new Html("button").text(button.text).on("click", (e) => {
        x.class("closing");
        setTimeout(() => {
          x.cleanup();
          button.callback(e);
        }, 350);
      });
      if (button.type && button.type === "primary")
        b.class("primary");
      if (button.type && button.type === "danger")
        b.class("danger");
      b.on("pointerenter", () => {
        playSound("hover");
      });
      b.on("click", () => {
        playSound("select");
      });
      b.appendTo(modalContent.elm.querySelector(".flex-group"));
    }
    x.appendTo(parent);
    let elementsArray;
    requestAnimationFrame(() => {
      const focusableElements = x.elm.querySelectorAll('a[href], button, textarea, input[type="text"], input[type="checkbox"], input[type="radio"], select');
      elementsArray = Array.prototype.slice.call(focusableElements);
      elementsArray.forEach((el) => {
        el.setAttribute("tabindex", "0");
      });
      elementsArray[0].addEventListener("keydown", (e) => {
        if (e.key === "Tab" && e.shiftKey) {
          e.preventDefault();
          elementsArray[elementsArray.length - 1].focus();
        }
      });
      elementsArray[elementsArray.length - 1].addEventListener("keydown", (e) => {
        if (e.key === "Tab" && !e.shiftKey) {
          e.preventDefault();
          elementsArray[0].focus();
        }
      });
    });
    return x;
  },
  alert: function(title, content, parent = "body") {
    return new Promise((res, _rej) => {
      this.modal(title, content, parent, {
        text: "OK",
        callback: (_) => res(true)
      });
    });
  },
  prompt: function(title, content, parent = "body", dangerous = false) {
    return new Promise((res, _rej) => {
      this.modal(title, content, parent, {
        text: "Yes",
        type: dangerous ? "danger" : "primary",
        callback: (_) => res(true)
      }, {
        text: "No",
        callback: (_) => res(false)
      });
    });
  },
  input: function(title, description, placeholder, parent = "body", isPassword = false, value = "") {
    return new Promise((res, _rej) => {
      let wrapper = new Html("div").class("col");
      let modal = this.modal(title, wrapper, parent, {
        text: "OK",
        type: "primary",
        callback: (_) => {
          res(input.elm.value);
        }
      }, {
        text: "Cancel",
        callback: (_) => res(false)
      });
      new Html("span").text(description).appendTo(wrapper);
      let input = new Html("input").attr({
        placeholder,
        value,
        type: isPassword === true ? "password" : "text"
      }).on("keyup", (e) => {
        const ev = e;
        if (ev.key === "Enter") {
          modal.class("closing");
          setTimeout(() => {
            modal.cleanup();
            res(input.elm.value);
          }, 350);
        }
      }).appendTo(wrapper);
    });
  }
};

